  {
    img: cartImage4,
  },
];

const product = [
  {
    img: productImage1,
  },
  {
    img: productImage2,
  },
  {
    img: productImage3,
  },
];
const review = [
  {
    img: reviewImage1,
  },
  {
    img: reviewImage2,
  },
  {
    img: reviewImage3,
  },
];
const blog = [
  {
    img: blogImage1,
  },
  {
    img: blogImage2,
  },
  {
    img: blogImage3,
  },
];
export { menu, cart, product, review, blog };
